;; **
;;; ### a la mano
;; **

;; @@

(def capture (v/new-videocapture))
(.open capture 0)

(def window
 (u/show (new-mat 200 200 CV_8UC3 rgb/black)))

(def buffer (new-mat))
(dotimes [i 200]
 (.read capture buffer)
 (u/re-show
  window
  buffer))

(.release capture)
