;; **
;;; ### find red
;; **

;; @@

(defn find-red[ buffer ]
   (let [
    work (new-mat)
    mat1 (new-mat)
    output (new-mat)
    ]
  (->  buffer
  (cvt-color! COLOR_BGR2HSV)
  (in-range! (new-scalar 0 30 30) (new-scalar 30 255 255) work))
     
  (copy-to buffer output work)
  (cvt-color output output COLOR_HSV2BGR))
  )

(u/simple-cam-window find-red)
